  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This downloadable file includes information
  regarding group practice participation in 2013 Centers for Medicare &amp; Medicaid
  (CMS) quality program as well as the 2013 Physician Quality Report System (PQRS)
  Group Practice Reporting Option (GPRO) performance rates for the three Diabetes
  Mellitus (DM) measures and one Coronary Artery Disease (CAD) measure now publicly
  reported on Physician Compare. Data are publicly available for the 139 group practices
  of 25 or more eligible professionals (EPs) that successfully reported data under
  the 2013 PQRS GPRO via the Web Interface. For information about public reporting
  on Physician Compare, visit the Physician Compare Initiative page. For all inquiries
  regarding Physician Compare, including this dataset, contact the Physician Compare
  support team at <a href=\"mailto:PhysicianCompare@Westat.com\">PhysicianCompare@Westat.com</a>.</p>n\",\n\t\"license_title\":
